window.bookSummaryJSON = "<p>A new chapter in the Limitless Lands saga begins. </p> <p>Vaguely remembering the accident that might have killed him, retired Navy captain Craig Larson is offered a chance at a new life. Choosing the body of a half-man, half-serpent creature called a naga, Larson must fight to secure a place for himself in this new world. Soon, he finds himself in a fight against pirates, thieves, and terrors of the deep, all of which seek to end his new life before it truly begins. </p> <p>But Larson is not easily deterred. He will call upon a loyal crew and decades of knowledge from his previous life, standing ready with steel and spell to cut down all who oppose him as he seeks to conquer the Limitless Seas.</p>"; 
